import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {App} from './App';
import reportWebVitals from './reportWebVitals';
import {left_side_f} from "./App";
let app = (
    <div>
    <div className="title">
    <section className="table">
    <App name = "left_title" id = "home" path = "#Home" content = "Home"/>
    <App name = "left_title" id = "aboutme" path = "#About Me" content = "About Me"/>
    <App name = "left_title" id="nan" path = "#Contact Me" content = "Contact Me"/>
    <App name = "right_title" id="login" path = "#Login" content = "Login"/>
    </section>
    </div>
    </div>
);
let leftSide = (
    <div className="content">
        <div className="left_side">
            <h1>This is my blog</h1>
            <left_side_f id = "Blog_post_#1" sname = "inner_table" iname = "inner_text" postNumber = "1" order = "1" numberOfDays = "1"/>
            <left_side_f id = "Blog_post_#2" sname = "inner_table" iname = "inner_text" postNumber = "2" numberOfDays = "2"/>
            <left_side_f id = "Blog_post_#3" sname = "inner_table" iname = "inner_text" postNumber = "3" numberOfDays = "3"/>
        </div>
    </div>
);

ReactDOM.render(
    app,
  document.getElementById('root')
);
ReactDOM.render(
    leftSide,
    document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
